const AboutText = () => {
  return (
    <p class="about-left lead">
      Founded in 2019 by Micheal, Approval1 has come a long way from its
      beginnings in California. When our team first started out, their passion
      for cars drove them to quit day job so that Approval1 can offer you the
      world's most best service. We now serve customers all over country, and
      are thrilled that we're able to turn our passion into our own website.
    </p>
  );
};
export default AboutText;
